import './App.css';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <nav>
          <link to='/Home' />
          <link to='/TopH' />
          <link to='/Login' />
        </nav>
      </BrowserRouter>
    </div>
  );
}

export default App;
